[assembly: IgnoresAccessChecksTo("Assembly-CSharp")]
[assembly: SecurityPermission(SecurityAction.RequestMinimum, SkipVerification = true)]
[module: UnverifiableCode]

namespace System.Runtime.CompilerServices
{
    [AttributeUsage(AttributeTargets.Assembly, AllowMultiple = true)]
    public class IgnoresAccessChecksToAttribute : Attribute
    {
        public IgnoresAccessChecksToAttribute(string assemblyName)
        {
            AssemblyName = assemblyName;
        }

        public string AssemblyName { get; }
    }
}

public class Downpour : PartialityMod
{
    // Update URL - don't touch!
    // You can go to this in a browser (it's safe), but you might not understand the result.
    // This URL is specific to this mod, and identifies it on AUDB.
    public string updateURL = "http://beestuff.pythonanywhere.com/audb/api/mods/4/3";
    // Version - increase this by 1 when you upload a new version of the mod.
    // The first upload should be with version 0, the next version 1, the next version 2, etc.
    // If you ever lose track of the version you're meant to be using, ask Pastebin.
    public int version = 9;
    // Public key in base64 - don't touch!
    public string keyE = "AQAB";
    public string keyN = "";
    // ------------------------------------------------
    public Downpour()
    {
        this.ModID = "Downpour";
        this.Version = "v0.8.1";
        this.author = "LeeMoriya";
    }
    public override void OnEnable()
    {
        base.OnEnable();
        mod = this;
        Initialize();
    }
    public static OptionInterface LoadOI()
    {
        return new DownpourConfig();
    }

    public static int palettecount = 0;
    public static Downpour mod;
    public void Initialize()
    {
        RainFall.Patch();
        RainPalette.Patch();
        //Load Snow Palette Image
        Downpour.snowTex = new Texture2D(32, 16, TextureFormat.ARGB32, false);
        Downpour.snowTex.anisoLevel = 0;
        Downpour.snowTex.filterMode = FilterMode.Point;
        byte[] snow = Convert.FromBase64String(Downpour.snowData);
        Downpour.snowTex.LoadImage(snow);
        Downpour.snowPileTex = new Texture2D(32, 16, TextureFormat.ARGB32, false);
        Downpour.snowPileTex.anisoLevel = 0;
        Downpour.snowPileTex.filterMode = FilterMode.Point;
        byte[] snowpile = Convert.FromBase64String(Downpour.snowPileData);
        Downpour.snowPileTex.LoadImage(snowpile);
        //Rain logo
        Downpour.logo = new Texture2D(32, 16, TextureFormat.ARGB32, false);
        Downpour.logo.anisoLevel = 0;
        Downpour.logo.filterMode = FilterMode.Point;
        byte[] logo = Convert.FromBase64String(Downpour.logoData);
        Downpour.logo.LoadImage(logo);
        //Snow Logo
        Downpour.logo2 = new Texture2D(32, 16, TextureFormat.ARGB32, false);
        Downpour.logo2.anisoLevel = 0;
        Downpour.logo2.filterMode = FilterMode.Point;
        byte[] logo2 = Convert.FromBase64String(Downpour.logo2Data);
        Downpour.logo2.LoadImage(logo2);
        //Snow Palette Ext1
        Downpour.snowExt1 = new Texture2D(32, 16, TextureFormat.ARGB32, false);
        Downpour.snowExt1.anisoLevel = 0;
        Downpour.snowExt1.filterMode = FilterMode.Point;
        byte[] snowExt1 = Convert.FromBase64String(Downpour.snowExt1Data);
        Downpour.snowExt1.LoadImage(snowExt1);
        //Snow Palette Ext2
        Downpour.snowExt2 = new Texture2D(32, 16, TextureFormat.ARGB32, false);
        Downpour.snowExt2.anisoLevel = 0;
        Downpour.snowExt2.filterMode = FilterMode.Point;
        byte[] snowExt2 = Convert.FromBase64String(Downpour.snowExt2Data);
        Downpour.snowExt2.LoadImage(snowExt2);
        //Snow Palette Int1
        Downpour.snowInt1 = new Texture2D(32, 16, TextureFormat.ARGB32, false);
        Downpour.snowInt1.anisoLevel = 0;
        Downpour.snowInt1.filterMode = FilterMode.Point;
        byte[] snowInt1 = Convert.FromBase64String(Downpour.snowInt1Data);
        Downpour.snowInt1.LoadImage(snowInt1);
    }

